class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        # if len(s) <= 1:
        #     return len(s)

        charSet = {}
        rst, i, j = 0, 0, 0

        while i < len(s):
            if s[i] in charSet.keys():
                rst = max(rst, len(charSet))
                for idx in range(j, charSet[s[i]]):
                    charSet.pop(s[idx])
                j = charSet[s[i]] + 1
                charSet[s[i]] = i
                i += 1
            else:
                charSet[s[i]] = i
                i += 1
        rst = max(rst, len(charSet))
        return rst

